"original": |2-
     3.  Order the set of collected keys.  For instance, keys referenced
         by "kid" (key ID) or "x5t" (X.509 certificate SHA-1 thumbprint)
         parameters might be tried before keys with neither of these
         values.  Likewise, keys with certain member values might be
         ordered before keys with other member values.  For some
         applications, no ordering will be applied.
"fixed": |-
  1.  Order the set of collected keys.  For instance, keys referenced by "kid" (key ID) or "x5t" (X.509 certificate SHA-1 thumbprint) parameters might be tried before keys with neither of these values.  Likewise, keys with certain member values might be ordered before keys with other member values.  For some applications, no ordering will be applied.
"ko": |-
  1. 수집된 키 집합을 정렬합니다. 예를 들어, "kid"(키 ID) 또는 "x5t"(X.509 인증서 SHA-1 지문) 매개변수에서 참조하는 키는 이러한 값이 없는 키보다 먼저 시도될 수 있습니다. 마찬가지로, 특정 멤버 값이 있는 키는 다른 멤버 값이 있는 키보다 먼저 정렬될 수 있습니다. 일부 애플리케이션의 경우 정렬이 적용되지 않습니다.
